/*Table structure for table `gd_link` */

DROP TABLE IF EXISTS `gd_link`;

CREATE TABLE `gd_link` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(120) NOT NULL COMMENT '标题',
  `comment` varchar(300) DEFAULT NULL COMMENT '备注',
  `url` varchar(300) DEFAULT NULL,
  `icon_id` int(11) DEFAULT NULL,
  `pid` int(11) DEFAULT '0' COMMENT '父节点id',
  `uid` int(11) DEFAULT NULL COMMENT '关联用户id',
  `sort` bigint(20) DEFAULT '1',
  `source` varchar(30) NOT NULL DEFAULT 'pc' COMMENT '网址添加来源',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT NULL,
  `version` int(11) DEFAULT '0' COMMENT '数据版本，每次修改都加1',
  `status` tinyint(4) DEFAULT '0' COMMENT '数据状态，0:正常',
  `is_catch` tinyint(4) DEFAULT '0' COMMENT '是否抓取图标，0:无，1:已抓取',
  `catch_time` timestamp NULL DEFAULT NULL,
  `icon` varchar(120) DEFAULT NULL COMMENT '图标icon',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16928 DEFAULT CHARSET=utf8;

