/*Table structure for table `gd_user` */

DROP TABLE IF EXISTS `gd_user`;

CREATE TABLE `gd_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL,
  `username` varchar(30) NOT NULL,
  `passwd` varchar(32) DEFAULT NULL,
  `email` varchar(30) DEFAULT NULL,
  `stype` enum('0','1','2') DEFAULT '0' COMMENT '共享类型，0:不共享也接受共享；1:共享者；2:接收共享者。',
  `scode` varchar(30) DEFAULT NULL COMMENT '随机共享码',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT NULL,
  `last_visit_time` timestamp NULL DEFAULT NULL COMMENT '最近访问时间',
  `visit_count` bigint(20) DEFAULT NULL COMMENT '总访问次量',
  `role_id` int(11) DEFAULT '0',
  `is_public` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:不公开 1:公开',
  `public_name` varchar(100) DEFAULT NULL COMMENT '分享的名字',
  `public_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '公开的时间',
  `focus_ids` varchar(255) DEFAULT NULL COMMENT '关注的人',
  `version` int(11) DEFAULT '0' COMMENT '数据版本，每次修改都增加1',
  `status` tinyint(4) DEFAULT '0' COMMENT '数据状态，0:正常',
  `style_code` varchar(30) DEFAULT 'white' COMMENT '样式ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=306 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

